import React from 'react';
import "./MyPage.scss"
import images from "../../assets/images/book.jpg"

const hobbies = "http://localhost:8080/profile";

class MyPage extends React.Component {
  render() {
    return (
      <div className="myPage">
        <div className="myPage__heading">
          <h1>MY EVENTS:</h1>
        </div>
        <div className="myPage__events">
          <img className="myPage__pictures" src={images} alt="book"></img>
          <div className="myPage__description">
            <h4>Event:</h4>
            <h4>Created by:</h4>
            <h4>Event:</h4>
          </div>
        </div>
      </div>
    )
  }

}

export default MyPage
